//import '../styles/components/Header.scss';
import logo from './images/logo.png';
const Header = (props) => {
  return (
    <>
      <header>
        <a href="/">
          <img src="./images/logo.png" alt="Calenpet logo" />
        </a>
      </header>
    </>
  );
};
export default Header;
